import React from 'react';

function Example() {
  return (
    <div>
      <SliderInput>
        <SliderTrack>
          <SliderTrackHighlight />
          <SliderMarker value={50} />
          <SliderHandle />
        </SliderTrack>
      </SliderInput>
    </div>
  );
}
